                return tslibs.ints_to_pytimedelta(arr.view(np.int64))
            elif dtype.kind == "m":
                result = arr.astype(dtype).astype(np.float64)
                result[isna(arr)] = np.nan
                return result
            elif dtype == _TD_DTYPE:
                return arr.astype(_TD_DTYPE, copy=copy)

